import React from 'react';

const Contact = () => {
    return (
        <div id="contact">
            <h2>Contact Us</h2>
            <p>Phone: 630-426-7001</p>
            <p>Pickup Location: Aurora IL</p>
        </div>
    );
}

export default Contact;
